/* Iida Peltonen 2022 */

import { useState, useEffect } from 'react';
import axios from 'axios';

const URL = 'https://restcountries.com/#api-endpoints-v3-all';

function App() {
  const [maat, setMaat] = useState([]);

  useEffect(getData, [])

  function getData() {
    axios.get(URL)
      .then((response) => {
        console.log(response.data)
        setMaat(response.data);
      }).catch(error => {
        alert(error);
      });
  }

  return (
    <div style={{padding: 30}}>
      <h3>Names</h3>
      <ol>
        {maat.map(maa => (
          <li>{maa.name}</li>
        ))}
      </ol>
    </div>
  );
}

export default App;
